import React, { useState } from 'react';
import './Map.css';
import ReactMapGL, { Marker } from 'react-map-gl';

function Map() {

    const [viewport, setViewport] = useState({
        latitude: 22.277733374673712,
        longitude: 114.17863235046072,
        zoom: 15,
        width: '100vw',
        height: '50vh',
        pitch: 25
    });

    return (
        <>
            <ReactMapGL 
                mapStyle={`mapbox://styles/mapbox/dark-v9`}
                mapboxApiAccessToken={
                    "pk.eyJ1IjoiY2xlZW1hcGJveCIsImEiOiJja20yeGQ5NTcwd3B2MndxdHhrcnFzcHd1In0.wlyT5Dn_MpY1ny6rLQLdOg"
                }
                {...viewport}
                onViewPortChange={(newView) => setViewport(newView)}
            >
                <Marker 
                    latitude={22.277733374673712} 
                    longitude={114.17863235046072} 
                    offsetTop={(-viewport.zoom * 5) / 2}
                >
                    <img src='https://cdn0.iconfinder.com/data/icons/small-n-flat/24/678111-map-marker-512.png'
                    width={viewport.zoom * 5}
                    height={viewport.zoom * 5}
                    />
                </Marker>
            </ReactMapGL>
       </>
    )
}

export default Map

